-- ----------------------------
-- Table structure for mmall_cart
-- ----------------------------
DROP TABLE IF EXISTS `mmall_cart`;
CREATE TABLE `mmall_cart` (
`id`  int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '购物车id' ,
`user_id`  int(11) UNSIGNED NOT NULL COMMENT '购物车所属用户id' ,
`product_id`  int(11) UNSIGNED NOT NULL COMMENT '商品id' ,
`quantity`  int(11) UNSIGNED NOT NULL DEFAULT 1 COMMENT '数量' ,
`checked`  tinyint(1) NOT NULL COMMENT '是否选择，1=已勾选，0=未勾选' ,
`create_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间' ,
`update_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`),
INDEX `user_id_index` (`user_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='购物车表'
AUTO_INCREMENT=121

;

