-- ----------------------------
-- Table structure for mmall_order
-- ----------------------------
DROP TABLE IF EXISTS `mmall_order`;
CREATE TABLE `mmall_order` (
`id`  int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单id' ,
`order_no`  bigint(20) UNSIGNED NOT NULL COMMENT '订单号' ,
`user_id`  int(11) UNSIGNED NOT NULL COMMENT '用户id' ,
`shipping_id`  int(11) UNSIGNED NOT NULL COMMENT '订单地址' ,
`payment`  decimal(20,2) NOT NULL COMMENT '实际付款金额，单位是元，保留两位小数' ,
`payment_type`  tinyint(4) UNSIGNED NOT NULL COMMENT '支付类型，1-在线支付' ,
`postage`  decimal(20,2) NULL DEFAULT 0.00 COMMENT '运费，单位是元' ,
`status`  smallint(10) UNSIGNED NOT NULL COMMENT '订单状态：0-已取消，10-未付款，20-已付款，40-已发货，50-交易成功，60-交易关闭' ,
`payment_time`  datetime NULL DEFAULT NULL COMMENT '支付时间' ,
`send_time`  datetime NULL DEFAULT NULL COMMENT '发货时间' ,
`end_time`  datetime NULL DEFAULT NULL COMMENT '交易完成时间' ,
`close_time`  datetime NULL DEFAULT NULL COMMENT '交易关闭时间' ,
`create_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间' ,
`update_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`),
INDEX `order_no_index` (`order_no`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='订单表'
AUTO_INCREMENT=103

;

-- ----------------------------
-- Records of mmall_order
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for mmall_order_item
-- ----------------------------
DROP TABLE IF EXISTS `mmall_order_item`;
CREATE TABLE `mmall_order_item` (
`id`  int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单子表id' ,
`user_id`  int(11) UNSIGNED NOT NULL COMMENT '订单所属用户id' ,
`order_no`  bigint(20) UNSIGNED NOT NULL COMMENT '订单号' ,
`product_id`  int(11) UNSIGNED NOT NULL COMMENT '商品id' ,
`product_name`  varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称' ,
`product_image`  varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品图片地址' ,
`current_unit_price`  decimal(20,2) NOT NULL COMMENT '生成订单时的商品单价，单位是元，保留两位小数' ,
`quantity`  int(10) UNSIGNED NOT NULL COMMENT '商品数量' ,
`total_price`  decimal(20,2) NOT NULL COMMENT '商品总价，单位是元，保留两位小数' ,
`create_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间' ,
`update_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`),
INDEX `order_no_index` (`order_no`) USING BTREE ,
INDEX `order_no_user_id_index` (`order_no`, `user_id`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='订单明细表'
AUTO_INCREMENT=113

;

-- ----------------------------
-- Records of mmall_order_item
-- ----------------------------
BEGIN;
COMMIT;

