-- ----------------------------
-- Table structure for mmall_product_comment
-- ----------------------------
DROP TABLE IF EXISTS `mmall_product_comment`;
CREATE TABLE `mmall_product_comment` (
`id`  int(11) NOT NULL AUTO_INCREMENT COMMENT '评论id' ,
`product_id`  int(11) UNSIGNED NOT NULL COMMENT '商品id' ,
`order_no`  bigint(20) UNSIGNED NOT NULL COMMENT '订单号' ,
`user_id`  int(11) UNSIGNED NOT NULL COMMENT '用户id' ,
`title`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '评论标题' ,
`content`  varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '评论内容' ,
`audit_status`  tinyint(4) UNSIGNED NOT NULL COMMENT '审核状态:0-未审核，1-已审核' ,
`create_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间' ,
`update_time`  datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间' ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='商品评论表'
AUTO_INCREMENT=32

;

-- ----------------------------
-- Records of mmall_product_comment
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for mmall_product_property_value
